import styled from 'styled-components'

const Div = styled.div`
    border-style: solid;
    width: 12em;
    height: 8em;
    margin: 1em;
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    allign-items: center;
    
    .h1 {
        margin: 0;
        padding: 0;
        font-size: 200%;
    }

    .h2 {
        margin: 0;
        padding: 0;
        font-size: 200%;
    }

`;

const Counter = ( { title='Orders on Queue', endpoint } ) => {
    return (
        <Div>
            <h2>{title}</h2>
            <h1>0000</h1>
        </Div>
    )
}

export default Counter
